function AddMeet()
{
    return(
        <div className="meet">
            <input type="text" className="inp" placeholder="Enter meet Title"/>
            <input type="text" className="inp" placeholder="Enter meet Link"/>
            <textarea placeholder="Enter meet description" className="meet-desc"></textarea>
            <button className="btn btn2">Add Meet</button>
        </div>
    );
}

export default AddMeet;
